import React, { Component } from "react";

class Agradecimentos extends Component {
  render() {
    return (
      <div className="Agradecimentos">
        <div className="ag_structure">
          <h1 className="title">Agradecimentos</h1>
          <p className="p-1">
            Agradeço a todas as pessoas que estiveram involvidas na criação e na
            montagem deste espetáculo, principalmente a todos os intérpretes
            pela sua contínua dedicação e empenho. Obrigado à Escola Superior de
            Música e Artes do Espetáculo pela cedência de salas para ensaios e
            desenvolvimento da composição coreográfica. Obrigado à Laura Pinto
            pela criação deste website. Obrigado a todos os apoios listados em
            baixo.
          </p>
        </div>
      </div>
    );
  }
}

export default Agradecimentos;
